import React, { Component } from 'react';
import Particles from 'react-particles-js';
import Clarifai from 'clarifai';
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import Rank from './components/Rank/Rank';
import FaceDetection from './components/FaceDetection/FaceDetection';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import './App.css';

const app = new Clarifai.App({
 apiKey: '4662bcd0f72f40c88203cc4561e1e39c'
});

const paramtersObject = {
  particles: {
    number: {
      value: 150,
      density: {
        enable: true,
        value_area: 800
      }
    }
  }
}


class App extends Component {
  constructor() {
    super();
    this.state = {
      input : '', 
      imageUrl : '',
      box : {}
    }
  }

  onInputChange = (event) => {
    this.setState({
      input : event.target.value
    });
  }

  calculateBoxDimensions = (data) => {
    const image = document.getElementById("image");
    const width = image.width;
    const height = image.height;
    console.log(width,height);
  }

  onButtonClick = () => {
    this.setState({ imageUrl : this.state.input});
    app.models.predict(Clarifai.FACE_DETECT_MODEL,
    this.state.input).then(
    function(response) {
      this.calculateBoxDimensions(response.outputs[0].data.regions[0].region_info.bounding_box);
    },
    function(err) {
      console.log("There was an error fetching the image");
    }
  );
  }

  render() {
    return (
      <div>
        <Particles className="particles" params={paramtersObject} />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm onInputChange={this.onInputChange} onButtonClick={this.onButtonClick}/> 
        <FaceDetection imageUrl={this.state.imageUrl} box={this.state.box}/>
      </div>
    );
  }
}

export default App;
